INSERT INTO `task` (`id`, `title`, `description`, `isAutomaticTest`, `backend`, `disallowedContent`) VALUES
	(1, 'Perfekte Zahl', 'Eine <strong>natrliche Zahl</strong> <em>n</em> heit perfekt oder vollkommen, wenn die Summe ihrer Teiler gleich n ist. Dabei sind die Teiler echt kleiner als <em>n</em>\r\n<p>. Beispielsweise ist 6 = 1 + 2 + 3 eine perfekte Zahl.</p>\r\n<p>&nbsp;</p>\r\nGeben Sie einen Algorithmus als <strong>Pseudocode</strong> an, der fr eine gegebene Zahl bestimmt, ob sie perfekt ist.', 0, NULL, NULL),
	(2, 'Kubikwurzel nach Heron', 'Erweitern Sie die Lsungsidee fr die Berechnung der Quadratwurzel nach Heron (siehe Vorlesungsfolien, Teil01, Folie 10) fr die Berechnung der Kubikwurzel. Beschreiben Sie diesen Algorithmus im <strong>Pseudocode</strong>\r\n<p>.</p>\r\n<p>&nbsp;</p>\r\n<p>\r\nTipp:</p>\r\nAnstatt der Lnge der Seite eines Quadrats mit Flcheninhalt <em>a</em> (Quadratwurzel in Vorlesung) bentigt man fr die dritte Wurzel von <em>v</em> die Lnge der Seite eines Kubus mit Rauminhalt <em>v</em>. Entwerfen Sie einen Algorithmus <strong>kubik</strong>, der einen Quader solange verndert bis annhernd alle Seiten gleich lang sind.', 0, NULL, NULL),
	(4, 'Primzahl', '<ol type="a">\r\n<li>Schreiben Sie eine Java-Methode \r\n<br /><br /><strong>public static boolean isPrime(int n)</strong>,<br /><br />\r\ndie mglichst effizient (siehe Blatt0, Aufgabe Primzahl) entscheidet, ob eine <strong>natrliche Zahl</strong> <em>n</em> eine Primzahl ist. Die Methode soll <em>true</em> zurckgeben, falls <em>n</em> eine Primzahl ist, im anderen Fall <em>false</em>.\r\n<p>&nbsp;</p>\r\n</li><li>Schreiben Sie eine weitere Methode \r\n<br /><br /><strong>public static int nextPrime(int n)</strong>,<br /><br />\r\ndie fr eine  <strong>natrliche Zahl</strong> <em>n</em> die kleinste Primzahl liefert, die grer oder gleich <em>n</em> ist.</li></ol>', 0, NULL, NULL),
	(5, 'Backus-Naur-Form (BNF)', '<ol type="a" start="1">\r\nSchreiben Sie in Backus-Naur-Form (BNF) gltige deutsche und amerikanische Datumsangaben (erst Monat, dann Tag, siehe unten).\r\n<br />Hinweis: Zur Vereinfachung werden folgende Annahmen getroffen:\r\n<ul>\r\n<li>Alle Monate knnen 31 Tage haben, die Tage 1 bis 9 werden ohne fhrende Null angegeben.</li>\r\n<li>Monatsangaben werden ebenfalls ohne fhrende Null geschrieben.</li>\r\n<li>Die Jahresangabe sei grundstzlich vierstellig.</li>\r\n<li>Es ist sowohl die deutsche als auch amerikanische Schreibweise zulssig.</li>\r\n<li>Gltige Datumsangaben sind:\r\n<br />3.11.2006\r\n<br />9.1.2007\r\n<br />11-3-2006 oder 11/3/2006\r\n<br />1-9-2007 oder 1/9/2007\r\n<br />2006-11-3 oder 2006/11/3\r\n<br />2007-1-9 oder 2007/1/9\r\n</li></ul>\r\n</ol>', 0, NULL, NULL),
	(6, 'Median', '<ol type="a">   \r\n<li>Schreiben Sie eine Java-Methode\r\n<br /><br /><strong>public static int median(int a, int b, int c)</strong>, <br /><br />\r\ndie von drei gegebenen ganzen Zahlen den <em>Median</em> (also den mittleren Wert in der sortierten Folge) der drei Zahlen ermittelt und zurck liefert.\r\n<p>Beispiel: <em>median(25, 11, 33)</em> ergibt <em>25</em></p>\r\n</li>\r\n<li>Geben Sie noch eine alternative Variante zur Bestimmung des Medians als Java-Methode <em>median2</em> an.</li>\r\n<li>Wie sieht ein mglicher Testrahmen fr Ihre Funktion <em>median</em> aus? Reichen Sie eine entsprechende main-Methode ein.\r\n<br />Hinweis: Die main-Methode wird nicht automatisch geprft aber in der bung diskutiert.</li></ol>', 0, NULL, NULL),
	(7, 'Zahlenpalindrome', '<p>Palindrome sind Zeichenketten, die von vorn und hinten gelesen das \r\nGleiche ergeben. Bsp.: Lagerregal. Gleiches funktioniert auch mit natrlichen Zahlen. So ist 94549 ein Zahlenpalindrom.<br />\r\nZiel ist nun bei einer gegebenen <strong>natrlichen Zahl</strong> (Dezimalzahl &gt; 0) zu bestimmen, ob sie ein Palindrom ist oder nicht. Entwickeln Sie dazu zunchst folgende Hilfsfunktionen, die bei der Lsung ntzlich seien knnen.</p>\r\n<ol type="a" start="1">\r\n<li> Schreiben Sie eine Java-Methode<br />\r\n  <br />\r\n  <strong>public static int numDigits(int n)</strong>,<br />\r\n  <br />\r\ndie die Anzahl an Dezimalstellen einer natrlichen Zahl ausgibt.<br />\r\nBsp.: numDigits(42) ergibt 2<br /></li>\r\n  <br />\r\n<li> Als nchstes wre ein Zugriff auf einzelne Ziffern hilfreich. Schreiben Sie dazu eine Java-Methode<br />\r\n  <br />\r\n  <strong>public static int getDigit(int n, int index)</strong>,<br />\r\n  <br />\r\ndie die i-te Dezimalziffer einer natrlichen Zahl ausgibt. Die Ziffern werden von <strong>hinten</strong> bei 0 begonnen zu zhlen. Die erste Ziffer ist also die mit dem Index 0.<br />\r\nBsp.: getDigit(2012, 1) ergibt 1<br />\r\n<br /> Fr die allgemeine Nutzung der Methode <em>getDigit</em> ist es sinnvoll, bei fehlerhaften Indizes folgendermaen vorzugehen:  Ist der Index kleiner Null soll die 0te Ziffer zurckgeliefert werden. Ist der Index grer als die Ziffernfolge lang ist, soll die letzte Ziffer (beachte Zhlung beginnt hinten!) zurckgeliefert werden.\r\n</li>  <br />\r\n<li> Schreiben Sie nun die Java-Methode<br />\r\n  <strong><br />\r\npublic static boolean isPalindrome(int n)</strong>,<br /><br />\r\ndie fr eine natrliche Zahl bestimmt, ob sie ein Palindrom ist oder nicht.\r\n</li></ol>', 0, NULL, NULL),
	(8, 'Umrechnung von Dezimal- in Dualzahl', '<p>Schreiben Sie eine Java-Methode</p>\r\n<p>&nbsp;</p>\r\n<strong>public static String transformDual(int dec)</strong>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\nzur Umwandlung einer beliebigen natrlichen Zahl <em>dec</em>\r\n<p> (dec&gt;0) in eine Dualzahl.\r\nTesten Sie diese Methode an verschiedenen Beispielen.</p>\r\nBeispiel: <em>transformDual(13)</em> liefert <em>"1101"</em>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>\r\nHinweis:</p>\r\nBenutzen Sie zur Lsung dieser Aufgaben <strong>keine</strong> Standardmethoden wie z. B. <em>Integer.toBinaryString(...)</em>', 0, NULL, NULL),
	(10, 'Zahlenspielerei MyIntArray', 'Schreiben Sie eine Klasse <em>MyIntArray</em> mit verschiedenen Methoden:\r\n<ol type="a" start="1">\r\n<li>Die Methode\r\n<br /><br /><strong>public static int[] createRandom(int n)</strong><br /><br />\r\nbekommt die Gre des zu erzeugenden Feldes bergeben, die Elemente des Feldes sollen mit ganzzahligen Zufallszahlen aus dem Bereich 5 bis einschlielich 99 belegt werden.\r\n<br />\r\n<br />Hinweis: Nutzen Sie zum Generieren der Zufallszahlen die Standardfunktion\r\n<em>random</em> aus der Klasse <em>Math</em>. Mit der Anweisung\r\n<div align="center"><em>int z = (int)(maxrand*Math.random());</em></div>\r\nwird eine Zufallszahl <em>z</em> zwischen <em>0</em> und <em>maxrand</em> erzeugt (0 &lt;= z &lt; maxrand).\r\n</li>\r\n<li><br /><strong>public static String toString(int[] a)</strong></li>\r\nsoll die Elemente von <em>a</em> in einem String zurck liefern. Testen Sie in <em>main</em> Ihr <em>toString(...)</em> und geben Sie das Feld auch mit der vordefinierten Methode <em>java.util.Arrays.toString(...)</em> aus.\r\n<li><br /><strong>public static int posMin(int[] a)</strong><br /><br />\r\nsoll die Position der kleinsten Zahl in <em>a</em> liefern. Wenn das minimale Element mehrmals vorkommt, soll nur die Position des <strong>ersten</strong> Auftretens ermittelt werden.</li>\r\n<li><br /><strong>public static void swap(int[] a)</strong><br /><br />\r\nvertauscht das erste mit dem letzten Element des Feldes <em>a</em>.</li>\r\n<ol></ol>\r\n</ol>', 0, NULL, NULL),
	(11, 'Befreundete Zahlen', '<p>Als befreundete Zahlen (amicable numbers) werden Paare natrlicher Zahlen (n, m) mit n  m bezeichnet, fr die gilt:</p>\r\n<p>\r\nDie Summe der echten Teiler von n ergibt m und Summe der echten Teiler von m ergibt n.</p>\r\n<p>\r\nBitte beachten Sie, dass auch 1 als Teiler von n betrachtet und mitsummiert wird, die Zahl n selbst aber nicht; beispielsweise ist die Summe der Teiler von 6 gleich 1 + 2 + 3.</p>\r\n<p>\r\nSchreiben Sie eine Java-Methode</p>\r\n<strong>public static int[][] amicablePairs(int n),</strong>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\ndie <em>n</em>\r\n<p> Paare befreundeter Zahlen liefert (Ergebnis ist eine zweispaltige Matrix).</p>\r\n<p>&nbsp;</p>\r\nHinweise:\r\n<ul>\r\n<li>Bei der Berechnung der befreundeten Paare ist darauf zu achten, dass die erste Zahl im jeweiligen Tupel die kleinere ist und keine Dubletten auftauchen.</li>\r\n<li>Beachten Sie beim Testen, dass die Ermittlung der befreundeten Paare mitunter viel Rechenzeit bentigt. Es ist daher ratsam, das <em>n</em> recht <strong>klein</strong> zu halten.</li>\r\n<li>Diskutieren Sie dabei verschiedene Implementierungsvarianten. </li></ul>', 0, NULL, NULL),
	(12, 'Perfektes Mischen', 'Sogenanntes perfektes Mischen eines Kartenstapels mit einer <strong>geraden</strong>\r\n<p>\r\nAnzahl von Karten funktioniert wie folgt:</p>\r\nDer Kartenstapel wird in der Mitte geteilt, dann werden die beiden Hlften so ineinander gemischt, dass die Karten aus den beiden Hlften genau abwechselnd im gemischten Stapel vorkommen.\r\n<p>&nbsp;</p>\r\n<p>Beispiel: Der ursprngliche Stapel enthalte Zehn, Bube,Dame, Knig, As, Joker. Die zwei Hlften enthalten dann einerseits Zehn, Bube, Dame und andererseits Knig, As, Joker. Nach dem Zusammenfgen ergibt sich die gemischte Reihenfolge Zehn, Knig, Bube, As, Dame, Joker.</p>\r\n<p>Der Einfachheit halber reprsentieren wir den Kartenstapel dabei als Feld\r\nvon natrlichen Zahlen.</p>\r\n<ol type="a" start="1">\r\n<li>Schreiben Sie zunchst eine  Methode\r\n<br /><strong>public static int[] interleave(int[] a1, int[] a2)</strong>,<br />\r\ndie zwei als gleich lang vorausgesetzte Felder <em>a1</em> und <em>a2</em> akzeptiert (muss nicht berprft werden) und ein Feld zurckgibt, in dem die Elemente aus <em>a1</em> und <em>a2</em> abwechselnd vorkommen, wobei mit dem ersten Element von <em>a1</em> begonnen wird.\r\nBeispiel\r\n<pre>int[] a1 = {1,2,3};\r\nint[] a2 = {4,5,6};\r\nint [] c = interleave(a,b); c enthlt die Elemente 1,4,2,5,3,6</pre>\r\n</li>\r\n<li>Schreiben Sie eine  weitere Methode \r\n<br /><strong>public static int[] perfectMerge(int[] a)</strong>,<br /> \r\ndie perfektes Mischen fr Felder mit einer geraden Anzahl von Elementen realisiert. Dazu muss zunchst das bergebene Feld in der Mitte geteilt werden und danach <em>interleave</em> aufgerufen werden.<br />\r\nBeispiel:\r\n<pre>int[] a = {1,2,3,4}\r\nperfectMerge(a) ergibt dann ein Feld mit den Elementen 1,3,2,4</pre>\r\n</li>\r\n<li>\r\nWird ein Kartenspiel oft genug perfekt gemischt, kehrt es in seine ursprngliche Reihenfolge zurck. Schreiben Sie nun eine Methode \r\n<br /><strong>public static int mergeNumber(int n)</strong>, <br />\r\ndie eine beliebige gerade Zahl grsser Null als Grsse eines Kartenstapels akzeptiert und die zurckgibt, wie oft ein Kartenstapel dieser Gre hchstens perfekt gemischt werden muss, damit er seine ursprngliche Reihenfolge wieder annimmt (wobei mindestens einmal gemischt werden muss).\r\n<br />\r\nBeispiel:\r\n<pre>mergeNumber(52) ergibt 8</pre>\r\n</li></ol>', 0, NULL, NULL),
	(13, 'Rekursive Funktion interpretieren I', 'Es ist folgende Funktion gegeben:\r\n<pre>Algorithm: f(x,y)\r\nInput:     x,y ganzzahlig\r\nOutput:    ?\r\n   if y = 0 then x\r\n            else f(x-1, y-1)\r\n   fi</pre>\r\n<ol type="a" start="1">\r\n<li>Beschreiben Sie die Auswertung an mehreren Beispielen. Was berechnet diese Funktion? Fr welche Werte terminiert der Algorithmus nicht?</li>\r\n<li>berlegen Sie wie der Algorithmus zu erweitern ist, damit er fr <em>alle</em> ganzzahligen Werte terminiert. Schreiben Sie dafr eine Java-Methode \r\n<br /><br /><strong>public static int rek(int x, int y)</strong>.<br /><br /></li>\r\n<li>Formulieren Sie nun Ihren verbesserten Algorithmus als <em>iterative</em> Methode\r\n<br /><br /><strong> public static int iter(int x, int y)</strong>.<br /><br /> </li></ol>', 0, NULL, NULL),
	(14, 'Rekursive Funktion interpretieren II', '<ol type="a" start="1">\r\n\r\n<li>Gegeben sei der folgende rekursive Algorithmus fr ganze Zahlen <em>n</em>:\r\n<pre>Algorithm: f(n)\r\nInput:     n ganzzahlig\r\nOutput:    ?\r\n   if n = 1  then 1\r\n             else f(n-1) + 2*n - 1\r\n   fi</pre>\r\nErlutern Sie anhand jeweils eines kurzen Beispiels, welche Berechnung der Algorithmus in den folgenden beiden Fllen ausfhrt:\r\n<br /><br /><em>n &gt; 0  </em> und <em>n &lt; = 0</em><br /><br />\r\n</li>\r\n<li>Gegeben sei der folgende rekursive Algorithmus fr ganze Zahlen <em>x</em> und <em>y</em> (div bedeutet ganzzahlige Division):\r\n<pre>Algorithm: f(x, y)\r\nInput:     x, y ganzzahlig\r\nOutput:    ?\r\n   if y = 0  then 1\r\n             else if(x &lt; 2 * y) then f(x, x - y)\r\n                                else x * f(x - 1, y - 1) div y\r\n                  fi\r\n   fi</pre>\r\n<ul>\r\n<li>Erlutern Sie anhand der Beispiele <em>f(4,2)</em> und <em>f(8,5)</em>, welche Berechnungen der Algorithmus ausfhrt.</li>\r\n<li>Fr welche <em>x</em> und <em>y</em> terminiert der Algorithmus nicht?</li>\r\n<li>Was ist die Semantik des Algorithmus?</li></ul>\r\n</li></ol>', 0, NULL, NULL),
	(15, 'Hornerschema', 'Reelle Polynome beliebigen Grades <em>n</em> knnen als Arrays der Lnge <em>n + 1</em>\r\n<p>\r\nreprsentiert werden:</p>\r\n<p>&nbsp;</p>\r\n<img src="polynom.png" alt="" width="90%/" />\r\n<p>&nbsp;</p>\r\n<ol type="a" start="1">\r\n<li>Schreiben Sie eine Methode\r\n<br /><br /><strong>public static double evalSimple(double[] a, double x)</strong>,<br /><br />\r\ndie durch sukzessive Summation der Ausdrcke <em>a<sub>i</sub>x<sup>i</sup></em>, <em>0</em><em>i</em><em>n</em> den Funktionswert <em>f(x)</em> fr eine Variable <em>x </em>berechnet. Wieviele Schleifendurchlufe werden bentigt (in Abhngigkeit von n)?\r\n<br />\r\nHinweis: Sie drfen nur Addition und Multiplikation verwenden.</li>\r\n\r\n<li>Schreiben Sie eine weitere iterative Methode\r\n<br /><br /><strong>public static double evalHorner(double[] a, double x)</strong>,<br /><br />\r\nzur Berechnung von <em>f(x)</em> nach dem Hornerschema, d. h. nach der Formel\r\n<p><em>f(x) = (((...((a<sub>n</sub>x + a<sub>n-1</sub>)x + a<sub>n-2</sub>)...)x + a<sub>2</sub>)x + a<sub>1</sub>)x + a<sub>0</sub>.</em></p>\r\n</li><li>Bestimmen Sie die Anzahl der Schleifendurchlufe, die mit dem Horner-Verfahren bentigt werden. Vergleichen Sie die Algorithmen aus <em>a)</em> und <em>b)</em> miteinander.</li>\r\n<li>Schreiben Sie eine rekursive Variante des Hornerschemas als Methode\r\n<br /><br /><strong>public static double evalHornerRek(double[] a, double x)</strong><br /><br /></li></ol>', 0, NULL, NULL),
	(16, 'Variante der Ackermann-Funktion', 'Die folgende Funktion berechnet <strong>eine Version</strong> (nach Abelson, Sussman: Structure and Interpretation of Computer Programs) der mathematischen Funktion mit dem Namen <em>Ackermann</em>:\r\n<pre>Algorithm Ackermann (x, y):\r\n   Input: natuerliche Zahlen x, y\r\n   Output: Ackermann-Zahl\r\n   \r\n   if (y = 0) then 0\r\n   if (x = 0) then 2*y\r\n   if (y = 1) then 2\r\n   else Ackermann(x-1, Ackermann(x, y-1))</pre>\r\n<ol type="1">\r\n<li>Schreiben Sie eine Java-Methode\r\n<br /><br /> <strong>public static BigInteger ackermann(BigInteger x, BigInteger y)</strong><br /><br />\r\nzur Berechnung der Ackermann-Zahl. Hinweis: Informieren Sie sich ber die Klasse <em>BigInteger</em> in der <a class="external-link" href="http://download.oracle.com/javase/6/docs/api/index.html">Java-API</a> (http://download.oracle.com/javase/6/docs/api/index.html).</li>\r\n<li>Welches sind die Werte der Methodenaufrufe <em>ackermann(1, 10), ackermann(2, 4), ackermann(3, 3)</em>?\r\n</li>\r\n\r\n<li>Die Klasse <em>BigInteger</em> dient der Verarbeitung beliebig groer ganzer Zahlen. Warum gibt es bei der Berechnung der Ackermann-Zahl trotzdem Probleme?</li></ol>', 0, NULL, NULL),
	(17, 'Fibonacci-Zahlen', 'Eine besondere Folge von Zahlen sind die Fibonacci-Zahlen, die rekursiv definiert werden knnen als\r\n<p>&nbsp;</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td><em>fib</em>(x) =</td>\r\n<td>if (x = 0)  (x = 1) then 1</td>\r\n</tr>\r\n<tr>\r\n<td></td>\r\n<td>else <em>fib</em>(x-2) + <em>fib</em>(x-1)</td>\r\n</tr>\r\n<tr>\r\n<td></td>\r\n<td>fi</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ol type="a" start="1">\r\n<li>Schreiben Sie eine rekursive Methode \r\n<br /><br /><strong>public static BigInteger fib1(int n)</strong><br /><br />\r\nzur Berechnung der x-ten Fibonacci-Zahl.\r\nGeben Sie im Hauptprogramm die ersten 15 Fibonacci-Zahlen aus.</li>\r\n<li>Zeigen Sie am Beispiel <em>fib1(5)</em>, wie die Anzahl der Aufrufe dieser Methode wchst (Baumrekursion) (Lsung als Block-Kommentar).</li>\r\n<li>Formulieren Sie eine iterative Methode \r\n<br /><br /><strong>public static BigInteger fib2(int n)</strong><br /><br />\r\nzur Berechnung der Fibonacci-Zahlen und zeigen Sie am Beispiel <em>fib2(5)</em>, dass <em>fib2</em> effizienter arbeitet als <em>fib1</em>.\r\n<br /> Hinweis: Merken Sie sich jeweils die beiden Vorgnger in gesonderten Variablen.</li>\r\n<li>Berechnen Sie innerhalb der main-Methode nach beiden Varianten die Fibonacci-Zahl von <em>n = 23</em> und zhlen Sie dabei die notwendigen Schleifendurchlufe.</li></ol>', 0, NULL, NULL),
	(18, 'Russische Bauernmultiplikation', 'Die Russische Bauernmultiplikation (auch gyptisches Multiplizieren oder Abessinische Bauernregel genannt) ist ein einfaches Verfahren zur Multiplikation zweier <strong>natrlicher Zahlen</strong>.\r\n<p>\r\n\r\nEs war schon im Altertum bekannt, in Deutschland wurde es bis ins Mittelalter verwendet. In Russland war es bis weit in die Neuzeit blich, daher der Name.</p>\r\nDas Verfahren hat den Vorteil, dass man im Prinzip nur halbieren, verdoppeln und addieren muss.\r\n<div>&nbsp;\r\n<p>Die Berechnung erfolgt nach folgendem Algorithmus:</p>\r\n<ol type="1" start="1">\r\n<li>Man schreibt die beiden zu multiplizierenden Zahlen nebeneinander.</li>\r\n<li>Auf der linken Seite werden die Zahlen jeweils halbiert (Reste abgerundet) und die Ergebnisse untereinander geschrieben, bis man zur 1 gelangt.</li>\r\n<li>Auf der rechten Seite werden die Zahlen jeweils verdoppelt und untereinander geschrieben.</li>\r\n<li>Die rechts stehenden (verdoppelten) Zahlen werden gestrichen, wenn die links stehende Zahl gerade ist.</li>\r\n<li>Die Summe der nicht gestrichenen rechts stehenden Zahlen ergibt das gesuchte Produkt.</li></ol>\r\n<p>\r\nberprfen Sie diesen Algorithmus an einem selbst gewhlten Beispiel.</p>\r\nSchreiben Sie in Java eine&nbsp;<strong>iterative</strong>&nbsp;Methode&nbsp;<br /><br /><strong>public static int farmerMultIter(int x, int y)</strong><br /><br />und eine&nbsp;<strong>rekursive</strong>&nbsp;Methode&nbsp;<br /><br /><strong>public static int farmerMultRek(int x, int y)</strong><br /><br />fr diesen Algorithmus.\r\n<div>&nbsp;</div>\r\n</div>', 0, NULL, NULL),
	(19, 'Tabbelchen gibt Anweisungen', '1A', 0, NULL, 'null'),
